import { SAVE_JOBS, SAVE_JOB_DETAIL } from "../Saga/index";

const initialState = {
  jobs: [],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
